@import "~css-reset-and-normalize";
@import "./core/constants";
@import "./core/mixins";

// -------------- Global -------------

body {
  position: relative;
  overflow-x: hidden;
  font-size: $font-middle;
  font-family: $font-family-content;
  font-family: sans-serif, Arial, Helvetica;
  line-height: 1.2;
}

* {
  box-sizing: border-box;
  &,
  &:before,
  &:after {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
  }
}

a {
  cursor: pointer;
  text-decoration: none;
  &:hover {
    cursor: pointer;
  }
}

h1,
h2,
h3,
h4,
h5,
h6 {
  font-family: $font-family-title;
  font-weight: bold;
}

.content {
  @include center-block();
}

div,
form,
input,
textarea,
h2 {
  border: 0;
}

// ---------------- Special ---------------------
.download-resume {
  opacity: 0.8;
  width: 350px;
  color: white;
  padding: 12px 50px 12px 50px;
  text-align: center;
  font-size: 12px;
  border: 1.5px solid;
  margin: 4px 2px;
  cursor: pointer;
  z-index: 30;

  &:hover {
    color: $dark-red;
    text-decoration: none;
    transition: ease 0.5s;
    background-color: rgba(253, 245, 249, 0.781);
  }
}

.underHeaderRedStrip {
  content: "";
  display: block;
  width: 55px;
  border: 3px solid $dark-red;
  margin: 15px 0;
}

hr {
  @include size(58px, 7px);
  background: $dark-red;
  margin: 15px 0 40px;
  border: none;
}

