sources.css/02.carousel.scss:
#carousel-section {
  position: absolute;
  top: 620px;
  height: 600px;
  width: 100%;

  & .carousel-indicators {
    position: absolute;
    bottom: 40px;
    z-index: 30;

    & li {
      height: 12px;
      width: 60px;
      border: 1px solid $dark-blue;
      border-radius: 20px;
    }
  }

  & .carousel-item {
    position: relative;
    height: 600px;
    width: 100%;
    z-index: 10;

    & h3 {
      color: black;
      text-align: left;
      font-size: $font-middle;
      font-weight: 900;
    }

    & .carousel-caption {
      position: absolute;
      top: 30px;
      left: 10%;
      line-height: 1.4;
      height: 500px;
      width: 80%;
    }

    & .paragraph-container {
      position: absolute;
      top: 210px;
      display: flex;
      flex-wrap: nowrap;
      overflow: hidden;
      height: 275px;


      & time {
        color: $light-blue;
        font-size: $font-middle;
        font-weight: 700;
      }

      & li {
        overflow: hidden;
        margin-right: 10px;
        min-width: 100px;
      }

      & p {
        overflow: hidden;
        text-align: left;
        line-height: 1.4;
        font-family: serif, Times;
        font-size: $font-small;
        color: black;
        padding: 15px 20px 15px 0;
        font-size: $font-small;
      }
    }
  }
}

// ------------------------- Page Tunner -------------------
.carousel-control-next,
.carousel-control-prev {
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  height: 40px;
  width: 40px;
  margin: 20px;
  border-radius: 50px;
  z-index: 30;

  & img {
    height: 20px;
    width: 24px;
    transition: ease 0.5s;

    &:hover {
      transform: scaleX(1.3);
      transform-origin: center;
    }
  }
}

// ------------------------------ Social Media -----------------------
#carousel-section .carousel-social-media {
  position: absolute;
  left: 50%;
  top: 140px;
  display: flex;
  flex-wrap: nowrap;
  height: 40px;
  width: 250px;
  z-index: 30;

  & li {
    display: inline;
  }

  & img {
    margin-right: 15px;
    height: 30px;
    width: 30px;
    border-radius: 15%;

    &:hover {
      cursor: pointer;
      width: 32px;
      height: 32px;
      transform: translateY(-5%);
    }
  }
}

// ------------------------------ First Slide -----------------------
.carousel-first-container h2,
.carousel-secend-container h2,
.carousel-third-container h2 {
  position: absolute;
  top: 100px;
  left: 0px;
  color: black;
  font-size: $font-extra-large;
  font-weight: 600;

  &::after {
    @extend .underHeaderRedStrip;
  }
}

.carousel-first-container .paragraph-container p {
  flex: 1;
}

// ------------------------------- Second Slide ----------------------
.carousel-secend-container .paragraph-container > li {
  width: 50%;
  text-align: left;
  font-size: $font-large;
}

.download-resume-carousel {
  @extend .download-resume;
  position: absolute;
  left: 80px;
  top: 80px;
  width: 300px;
  color: black;
  margin-left: 50%;
  border: 1px solid black;
}

// ------------------------------- Third Slide ----------------------
.carousel-third-container .paragraph-container li {
  flex: 1;
}

