.information-header-public {
  position: relative;
  top: 78px;
  font-size: $font-extra-large;

  &::after  {
    @extend .underHeaderRedStrip;
  }
}

// --------------------------------- Lift Form ------------------------------
.information-section-left {
  @extend .public-information-section;
  background: $dark-blue;

  & h2 {
    @extend .information-header-public;
    color: white;
    left: 5%;
  }

  & table {
    position: relative;
    left: 5%;
    top: 120px;
  }

  & table th {
    width: 40%;
    font-size: $font-large;
  }

  & a {
    color: white;
    font-size: $font-small;
    text-decoration: none;
  }
}

// --------------------------------- Right Form ------------------------------
.information-section-right{
  @extend .public-information-section;
  background: $basic-blue;

  & h2 {
    @extend .information-header-public;
    position: relative;
    left: 5%;
    color: black;
  }

  & form{
    position: relative;
    left: 5%;
  }

  & div:nth-child(1),
  div:nth-child(2){
    display: inline-block;
  }

  & input, textarea
  {
    position: relative;
    left: 0;
    font-size: $font-small;
    line-height: 2.5;
    border-bottom: 1px solid black;
    background-color: $basic-blue;
  }

  & textarea{
    position: relative;
    top: 20px;
    left: 5px;
  }

  & input::-webkit-input-placeholder, 
  textarea::-webkit-input-placeholder
  {
    color: white;
  }

  & button {
    position: relative;
    top: 30px;
    left: 135px;
    height: 30px;
    width: 120px;
    color: white;
    font-size: $font-large;
    font-weight: 700;
    opacity: 0.8;
    background-color: $basic-blue;
    border: 0 solid $basic-blue;
    border-radius: 20px;

    &:hover{
      color: $dark-blue;
      transition: ease .5s;
    }
  }
}

